import { Component } from '@angular/core';
import { UserInterface } from '../../interfaces/user.interface';
import { AuthService } from '../../services/auth.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {

  user: UserInterface = {
    firstName: '',
    lastName: '',
    age: '',
    email: '',
    username: '',
    password: '',
  }

  confirmPassword: string | undefined;

  constructor(public authService: AuthService, private router: Router) { }

  register() {

    if(this.confirmPassword != this.user.password){
      console.log('contraseñas no coinciden')
    }   

    if(this.user.age){
      +this.user.age
    }

    console.log(this.user);

    this.authService.register(this.user).subscribe((data) => {
      console.log(data);
      const accessToken = data.accessToken;
      const refreshToken = data.refreshToken;
      this.authService.saveTokens(accessToken, refreshToken);
      console.log('user created succesfully')
      this.router.navigateByUrl('/home')

    });
  }
}
<div class="register">
  <form #productForm="ngForm" class="custom-form" >
    <h1>Sign up</h1>
    <input type="text" name="firstName" [(ngModel)]="user.firstName" required placeholder="First name">
    <input type="text" name="lastName" [(ngModel)]="user.lastName" required placeholder="Last name">
    <input type="number" name="age" [(ngModel)]="user.age" placeholder="Age (optional)">
    <input type="text" name="email" [(ngModel)]="user.email" required placeholder="Email">
    <input type="text" name="username" [(ngModel)]="user.username" required placeholder="Username">
    <input type="text" name="password" [(ngModel)]="user.password" required placeholder="Password"> 
    <input type="text" name="lastName" [(ngModel)]="confirmPassword" required placeholder="Confirm password">
    <button (click)="register()">Enviar</button>
  </form>
</div>
